import React from 'react';
import './ProfileForm.css';

import { validate } from '../../hooks';
import { useForm } from '../../hooks';
import { GovResourceForm } from './GovResourceForm';
import { PreviousExpForm } from './PreviousExpForm';
import { EducationForm } from './EducationForm';
import { SocialNetworkForm } from './SocialNetworkForm';

const ProfileForm = ({ user, createProfile }) => {
  const { values, handleChange, handleSubmit, errors } = useForm(
    createProfile,
    validate
  );
  return (
    <div className="profile-form">
      <form onSubmit={handleSubmit}>
        <GovResourceForm
          values={values}
          handleChange={handleChange}
          errors={errors}
        />
        <EducationForm values={values} handleChange={handleChange} />
        <SocialNetworkForm values={values} handleChange={handleChange} />
        <PreviousExpForm values={values} handleChange={handleChange} />
        <div className="submit-buttons">
          <button>Save</button>
          <input type="reset" value="Clear" />
        </div>
      </form>
    </div>
  );
};

export default ProfileForm;
